export default function AgeChecker() {

    const person = {
        age: 29
      }
    useEffect(() => {
        if(person.age < 18){
            console.log("Under 18")
        }else if(person.age < 21){
            console.log("Under 21")
        }else{
            console.log("Ok to drink")
        }
    }, [])
    return(
        <>
